import styled from 'styled-components'

export const CheckBox = styled.div`
    background: #5887F9;
    padding: 2px;
    height: 18px;
    width: 18px;
    color: white;
    border-radius: 100%;
    display: flex;
    flex-direction: row;
    justify-content: center;
    align-items: center;
`
